from flask import Flask, render_template
import random

app = Flask(__name__)
my_api = [{'anml' : 'jellyfish', 'img': "data:image/jpeg;base64,"}, 
{'anml' : 'anglerfish', 'img' : 'data:image/jpeg;base64,'},
              {'anml' : 'squid', 'img' : 'data:image/jpeg;base64,'}]

# @app.route("/<name>")
# def hello_world(name):
#     return render_template('index.html')

@app.route('/api')
def api():
    return random.choice(my_api)
@app.route('/<num>')
def greater_or_less_10(num):
    num = float(num)
    if num == int(num):
        num = int(num)
    if num > 10:
        return f'{num} is greater than 10'
    elif num == 10:
        return f'{num} is equal to 10'
    else: 
        return f'{num} is less than 10'

@app.route('/display/<animal>')
def display(animal):
    anml = ''
    pict = ''
    if animal == 'jellyfish' or animal == 'squid' or animal == 'anglerfish':
        if animal == 'jellyfish':
            anml = my_api[0]['anml']
            pict = my_api[0]['img']
        if animal == 'anglerfish':
            anml = my_api[1]['anml']
            pict = my_api[1]['img']
        if animal == 'squid':
            anml = my_api[2]['anml']
            pict = my_api[2]['img']
        return render_template('index.html', anml=anml, pict=pict)
    else:
        return 'Animal not Found'
if __name__ == '__main__':
    app.run(debug=True, host='0.0.0.0', port=4999)

